INSERT INTO "quotation_details" VALUES(1,'Amrit Engineering','Service Tax No. : APRPK1196BSD001','Providing Generator on Rent Basis & Allied Services ','87270 - 09500 <br /> 0161 - 2493500 <br /> 80540 - 70500','# 1380, St. No. 31, Janta Nagar, Bhagwan Chowk','Near Public Health Center, Ludhiana-141003',NULL,'Subject: Providing Automation Silent Generator on Monthly Rent Basis','With Regards,,','On the captioned subject we are pleased to introduce ourselves as service provider in the field of Generator on monthly rent basis. It is for your kind consideration that we are providing the generator sets on monthly rent basis to the banks and other Govt. offices. We have proper infrastructure and staff to serve best to our customers. At present we proudly declare that we are serving many branches of :','Allahabad Bank:','Oriental Bank of Commerce :','Bank of Baroda :','The Federal Bank Limited :','Central Bank of India :','Ludhiana Zone :','Amritsar Zone :','Through this letter, we are offering our services to bank. Our monthly rent is quoted as:','<li>Rs-7250.00 for 5.0 Kva</li><li>Rs-9500.00 for 7.5 Kva</li><li>Rs-11000.00 for 10.0 Kva</li><li>Rs-12500.00 for 12.5 Kva</li><li>Rs-13000.00 for 15 Kva</li><li>Rs-13500.00 for 20 Kva</li><li>Rs-17000.00 for 25.00 Kva</li><li>Rs-19500.00 for 31.05 Kva</li><li>Rs-21500.00 for 35.00 Kva</li><li>Rs-27000.00 for 40 Kva</li><li>Rs-29500.00 for 50 Kva</li><li>Rs-39500.00 for 62.5 Kva</li><li>Rs-43500.00 for 75.0 Kva</li>','We shall increase 10% after two years. The rent will include repairs &amp; maintenances and the cost of diesel. Space will be provided by you. Our generator sets will be soundproof &amp; automatic. We shall install only the branded generator sets. If you want higher capacity generator then we may fulfill your demand. Above rates are for all seasons.','We hope you will consider our application and give an opportunity to serve your bank. We ensure you of our best service.','Thanking You','Yours Truly','For Amrit Engineers','ishnoorsingh@in.com','jasvirsinghsond@gmail.com','amritengineers80@gmail.com','amritengineers@yahoo.in','+91 98140-09500','+91 87270-09500','0161-2439500','Date : 09/06/2015',1,1,'2015-03-31 12:42:08.616036','2015-03-31 12:43:35.314370','f',NULL,NULL);
