ed generator sets. If you want higher capacity generator then we may fulfill your demand. Above rates are for all seasons.','We hope you will consider our application and give an opportunity to serve your bank. We ensure you of our best service.','Thanking You','Yours Truly','For Amrit Engineers','ishnoorsingh@in.com','jasvirsinghsond@gmail.com','amritengineers80@gmail.com','amritengineers@yahoo.in','+91 98140-09500','+91 87270-09500','0161-2439500','2015-06-21',34,4,'2015-06-22 03:00:38.337773','2015-06-22 03:01:16.066508',NULL,NULL);
